import axios from 'axios';
// export const apiOptions: RequestInit = {
//   method: 'GET',
//   headers: {
//     'X-RapidAPI-Key': '13f7b1cd2dmsh805857b48dc7bbep17a950jsn7532e4c61cb4',
//     'X-RapidAPI-Host': 'wft-geo-db.p.rapidapi.com',
//   },
// };

const apiOptions = axios.create({
  baseURL: process.env.GEO_APP_API_URL,
});

apiOptions.interceptors.request.use(config => {
  config.url =
    config.url +
    'cities?' +
    'minPopulation=100000' +
    process.env.GEO_APP_API_KEY;
  return config;
});
export default api;
